import React from "react";
import Header from "../Components/Header";
import About from "../Components/About";

function AboutPage(props) {
  return (
    <div>
      <Header mainHeader={props.mainHeader} />
      <About>
        <p style={{ color: " #FAF0E6" }}>
          I consider myself to be a forever-learner who hails from Pakistan and
          is currently attending The University of Miami and
        </p>
        <p style={{ color: " #FAF0E6" }}>
          am completing my bachelor's degree in Computer Science and Economics
          with minors in Mathematics and Business Law
        </p>
        <p style={{ color: " #FAF0E6" }}></p>
        <p style={{ color: " #FAF0E6" }}>
          ME------------------------------------------------------------------------------------------------------
        </p>
      </About>
    </div>
  );
}

export default AboutPage;
